import React, { Component } from 'react';
import BottomNavRightItem from 'BottomNavRightItem';
import DropdownItem from 'DropdownItem';
import { FcSearch } from 'react-icons/fc';
import RightItem from 'RightItem'

class BottomNavRight extends Component {
    constructor() {
        super();
        this.state = {
            RightItem: RightItem
        }
    }
    
    mapping(x) {
           const members=x.map(member=> <BottomNavRightItem
                    key={member.id}
                    href={member.href}
                    className={member.className}
                    bottom={member.bottom}
           />);
        return members;
        }
    
    render() {
        return (
            <div className="col-lg-6 col-md-6 col-sm-12 col-xs-12 attr-nav">
                <ul className="bottom-nav-list-inline2">
                    {this.mapping(this.state.RightItem)}
                    <li className="dropdown"><a href="#" className="nav-link dropdown-toggle arrow nav-link-hover" data-toggle="dropdown">المركبات</a></li>
                    <ul className="dropdown-menu">
                        <DropdownItem
                            DropInfo={{
                                className:"drobmenu-li",
                                href:"new-cars.html",
                                buttom:'سيارات جديده'
                            }}
                            
                        />
                        <DropdownItem
                            DropInfo={{
                                className:"drobmenu-li",
                                href:"used-cars.html",
                                buttom:'سيارات مستعمله'
                            }}

                        />
                        <DropdownItem
                            DropInfo={{
                                className:"drobmenu-li",
                                href:"motors.html",
                                buttom:'موتوسيكلات'
                            }}
                        />
                        <DropdownItem
                            DropInfo={{
                                className:"drobmenu-li-noborder",
                                href:"boats.html",
                                buttom:'قوارب'
                           }}
                        />
                    </ul>
                    <BottomNavRightItem
                        RightItem={{
                            href:"home.html",
                            className:"active nav-link-hover",
                            bottom:'الرائيسية'
                            }}
                    />
                   <li className="search"><FcSearch /></li>
                </ul>
            </div>
        );
    }
}

export default BottomNavRight;
